import React from 'react';
import { Laptop2, Clock, CheckCircle, RotateCcw } from 'lucide-react';

const DashBoardLists = () => {
    const devicesExpiring = [
        { id: 1, name: 'Laptop Dell', expirationDate: '2025-04-25' },
        { id: 2, name: 'Máy chiếu Epson', expirationDate: '2025-04-30' },
        { id: 3, name: 'Smartphone iPhone', expirationDate: '2025-04-28' },
    ];

    const devicesAwaitingApproval = [
        { id: 1, name: 'Máy in Canon', requestDate: '2025-04-10' },
        { id: 2, name: 'Bàn phím Logitech', requestDate: '2025-04-12' },
    ];

    const devicesAwaitingReturn = [
        { id: 1, name: 'Tai nghe Bose', requestDate: '2025-04-05' },
        { id: 2, name: 'Máy tính xách tay HP', requestDate: '2025-04-08' },
    ];

    const renderDeviceList = (devices, title, dateKey, Icon, iconColor) => (
        <div className="mb-10 w-full md:w-1/2 xl:w-1/3 px-3">
            <div className="bg-white dark:bg-gray-800 shadow-lg rounded-2xl p-5 transition duration-300">
                <div className="flex items-center mb-4">
                    <div className={`w-10 h-10 flex items-center justify-center rounded-full bg-opacity-20 ${iconColor}`}>
                        <Icon className={`${iconColor.replace('bg-', 'text-')} w-5 h-5`} />
                    </div>
                    <h3 className="ml-3 text-lg font-semibold text-gray-800 dark:text-gray-100">{title}</h3>
                </div>
                <ul className="space-y-4">
                    {devices.map(device => (
                        <li
                            key={device.id}
                            className="flex justify-between items-center bg-gray-50 dark:bg-gray-700 hover:bg-gray-100 dark:hover:bg-gray-600 transition rounded-lg px-4 py-3"
                        >
                            <span className="text-gray-700 dark:text-gray-100 font-medium">{device.name}</span>
                            <span className="text-sm text-gray-500 dark:text-gray-300">
                                {dateKey === 'expirationDate' ? 'Hạn: ' : 'Yêu cầu: '}
                                <span className="font-semibold">{device[dateKey]}</span>
                            </span>
                        </li>
                    ))}
                </ul>
            </div>
        </div>
    );

    return (
        <div className="w-full px-6 py-8 mx-auto">
            {/* Cards Row */}
            <div className="flex flex-wrap -mx-3 mb-10">
                {/* Card example */}
                {[
                    {
                        label: "Today's Money",
                        value: "$53,000",
                        change: '+55%',
                        note: 'since yesterday',
                        icon: 'ni ni-money-coins',
                        bg: 'from-blue-500 to-violet-500',
                    },
                    {
                        label: "Today's Users",
                        value: '2,300',
                        change: '+3%',
                        note: 'since last week',
                        icon: 'ni ni-world',
                        bg: 'from-red-600 to-orange-600',
                    },
                    {
                        label: 'New Clients',
                        value: '+3,462',
                        change: '-2%',
                        note: 'since last quarter',
                        icon: 'ni ni-paper-diploma',
                        bg: 'from-emerald-500 to-teal-400',
                    },
                    {
                        label: 'Sales',
                        value: '$103,430',
                        change: '+5%',
                        note: 'than last month',
                        icon: 'ni ni-cart',
                        bg: 'from-yellow-500 to-orange-500',
                    },
                ].map((card, index) => (
                    <div key={index} className="w-full sm:w-1/2 xl:w-1/4 px-3 mb-6">
                        <div className="bg-white dark:bg-gray-800 shadow-xl rounded-2xl p-4 transition duration-300">
                            <div className="flex justify-between items-center">
                                <div>
                                    <p className="text-sm font-semibold text-gray-600 dark:text-gray-300">{card.label}</p>
                                    <h5 className="text-xl font-bold text-gray-900 dark:text-white">{card.value}</h5>
                                    <p className="text-sm text-emerald-500 font-bold">
                                        {card.change}{' '}
                                        <span className="text-gray-500 dark:text-gray-400 font-normal">{card.note}</span>
                                    </p>
                                </div>
                                <div className={`w-12 h-12 bg-gradient-to-tl ${card.bg} rounded-full flex items-center justify-center`}>
                                    <i className={`${card.icon} text-white text-lg`}></i>
                                </div>
                            </div>
                        </div>
                    </div>
                ))}
            </div>

            {/* Device Lists */}
            <div className="flex flex-wrap -mx-3">
                {renderDeviceList(devicesExpiring, 'Thiết bị sắp hết hạn', 'expirationDate', Clock, 'bg-orange-500')}
                {renderDeviceList(devicesAwaitingApproval, 'Thiết bị chờ phê duyệt', 'requestDate', CheckCircle, 'bg-blue-500')}
                {renderDeviceList(devicesAwaitingReturn, 'Thiết bị chờ thu hồi', 'requestDate', RotateCcw, 'bg-red-500')}
            </div>
        </div>
    );
};

export default DashBoardLists;
